   "source": [
    "ASIGNMENT_2:\n",
    "Objectives:\n",
    "\n",
    "- Create an \"InteractionNetwork\" object to contain the members of each network.\n",
    "- Annotate it with any KEGG path of which the members of the interaction network are part both the KEGG ID and the path name\n",
    "- Annotate with the GO Terms associated with the total of all genes in the network.\n",
    "- BUT ONLY OF THE BIOLOGICAL PROCESS PART OF THE GO ONTOLOGY! Both the GO:ID and the GO term name\n",
    "- Create a report of which members of the gene list interact with each other, along with the KEGG/GO functional annotations of those interacting members.\n"
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {
    "id": "9Vkps5EAMp-0"
   },
   "source": [
    "Workflow:\n",
    "\n",
    "First we are going to create the Protein and Network classes needed for further development of our code.\n",
    "Then, after creating the matrix where we will store the proteins, we obtain the protein identifiers for each gene. We will also obtain the GO terms (exclusively those associated with the category \"Biological Processes\", focusing on those whose identifier begins with P, since they have the format \"P:GO:*******\"), as well as the KEGG pathways for each gene. For this, we will use the togows database.\n",
    "\n",
    "To continue, we will identify the possible interactions involving the genes in our list. To do this, we will identify the IntAct code for each of the proteins and by using the Psicquic database, we will retrieve the proteins with which it interacts. To generate the interaction networks we will assume that given two proteins from our list, A and B, if a third protein, C, whether from the list or not, interacts at the same time with A and B, then all 3 proteins will be part of a network. \n",
    "\n",
    "Finally, we will screen print the networks with the respective proteins, GO terms associated with the category \"Biological processes\" and KEGG pathways. \n",
    "\n"
   ]
  },
